uint32_t status;
uint32_t songIDX;
uint32_t idx;
	
void Timer0_Handler(void){
	if(status == 0){
		Sound_Play(Snakemusict,idx);
		idx  = (idx + 1) % 22045;
	}
	else if(status == 1){
	//	Sound_Play(DeathSong,idx);
		idx  = (idx + 1) % 7885;
	}
	else if(status == 2){
		//Sound_Play(footstep,idx);
		idx = (idx + 1) % 1296;
	}
	else if(status == 3){
		//Sound_Play(crunch,idx);
		idx = (idx + 1) % 986;
	}
}

void Sound_Init(void){
// write this
	DAC_Init();
	idx = 0;
	status = 0;
	songIDX = 0;
	Timer0_Init(Timer0_Handler);
}

void Sound_Play(const uint8_t *pt, uint32_t count){
// write this
	DAC_Out(pt[count]);
};

void Sound_Death(void){
	if(status == 0)
		songIDX = idx;
	idx = 0;
	status = 1;
}
void Sound_Run(void){
	idx = songIDX;
	status = 0;
}

void Sound_step(void){
	if(status == 0)
		songIDX = idx;
	idx = 0;
	status = 2;
}

void Sound_eat(void){
	if(status ==0)
		songIDX = idx;
	idx = 0;
	status = 3;
}
